import React from 'react'
import Icon from '@mdi/react'
import { mdiArrowDownDropCircleOutline } from '@mdi/js';
import './WeatherTile.css';
export default WeatherTile;

/*class WeatherTile extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      isLoading: false,
    }
  }
  render() {
    return(
      <div className="tile">
        <div className="weatherIco">
          <h3>{this.props.main}</h3>
        </div>
      </div>
    )
  }
}*/
function WeatherTile(props) {
  let weather;
  if(props.today) {
    weather = <p>{props.today}</p>
  } else {
    weather = <p>{props.high} / {props.low}</p>
  }
  return(
    <div className="tile">
      <div className="weatherIco">
      <img src={props.icon} alt="image"/>
      </div>
        <p>{props.date}</p>
        {weather}
        <Icon
        className="downArrow"
        path={mdiArrowDownDropCircleOutline}
        size={1}
        horizontal
        vertical
        rotate={180}
        color="#333"/>
    </div>
  )
}
